import React from "react";

const DetalleBusquedaCategorias = (props) => {
    return (
        <div style={{ backgroundColor: '#c1c1c1', padding: '20px' }}>
            <div style={{ margin: '0 auto', maxWidth: '100%', overflowX: 'auto' }}>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>Detalle</th>
                            <th>ID Categoria</th>
                            <th>Nombre de Categoria</th>
                            <th>Eliminar</th>
                        </tr>
                    </thead>
                    <tbody>
                        {props.ListaCategorias.map((item, i) => (
                            <tr key={i}>
                                <td><button className="btn btn-success" onClick={() => props.DetallesCategorias(item.ID_TipoProducto)}>Detalles</button></td>
                                <td>{item.ID_TipoProducto}</td>
                                <td>{item.Descripcion}</td>
                                <td><button className="btn btn-danger" onClick={() => props.ClickBtnDelete(item.ID_TipoProducto)}>Eliminar</button></td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default DetalleBusquedaCategorias;
